import React from "react";
import "./UserForm.css";
import InputAge from "./Input/InputAge";
import InputName from "../Input/InputName";

const UserForm = (props) => {
  return (
    <div>
      <h2>User Name</h2>
      <InputName />
      <h2>User Age</h2>
      <InputAge />
    </div>
  );
};

export default UserForm;
